import React from "react";

const mapImg =
  "https://tile.openstreetmap.org/6/36/20.png"; // просто заглушка, чтобы было «что-то» на месте карты

export default function Office(){
  return (
    <section className="section" style={{paddingTop:32}}>
      <div className="container">
        <h2 style={{textAlign:"left"}}>Наш офис</h2>

        <div className="grid cols-2" style={{alignItems:"start"}}>
          <div>
            <img
              src={mapImg}
              alt="Карта (заглушка)"
              style={{width:"100%", borderRadius:12, border:"1px solid #eee", aspectRatio:"4/3", objectFit:"cover"}}
            />
          </div>

          <div style={{display:"grid", gap:16, justifyContent:"end", alignContent:"start"}}>
            <div style={{textAlign:"right", fontSize:18}}>
              <div>Ventagregat@yandex.ru</div>
              <div style={{marginTop:8}}>+7 111 111 11 11</div>
              <div style={{marginTop:8}}>г. Москва, ул. Душинская 18К1</div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
